ad_creative_bodies:
Un lider care are o viziune, inspiră încredere și animă națiunea, trebuie să găsească un echilibru între trei zone: 
nevoile oamenilor - problemele legate de puterea de cumpărare, inflație, viața dificilă a copiilor, bătrânilor și tinerilor; 
nevoile țării - reprezentare externă, investiții străine; 
viziunea liderului - respect pentru oameni, luptă pentru ei și le croiește un drum sigur, într-o lume în schimbare.

Economia României dă semne clare că se sufocă: creșterea economică încetinește vertiginos, deficitul balanței comerciale și cel de cont curent se adâncesc, iar investitorii fug. În 2009, România a fost luată complet pe nepregătite de criza economică, s-au tăiat salariile, s-au mărit taxele și nu aș vrea să repetăm acea experiență amară.

Ce face Guvernul acum? În loc să încerce să stimuleze economia, politicile publice sunt ostile antreprenorilor și capitalului românesc. În loc să creștem atractivitatea investițională printr-un mediu de afaceri transparent și predictibil, sufocăm antreprenorii cu modificări fiscale și taxe.

România nu mai are timp de politici economice bâlbâite, scrise pe genunchi. Suntem deja într-o spirală periculoasă, din care nu avem cum să ieșim decât cu măsuri deștepte și atent coordonate.

Ca viitor președinte al României, nu voi ezita să îmi folosesc prerogativele constituționale pentru a trezi din adormire Guvernul și a lua măsurile necesare pentru a proteja puterea de cumpărare, locurile de muncă, pentru a evita creșterile de taxe și a limita inflația:
- investiții masive în dezvoltarea regională;
- sprijinirea antreprenoriatului, creșterea producției românești și reducerea importurilor;
- investiții masive în sectoarele cu valoare adăugată mare, în cercetare și în economia cunoașterii;
- o rată de absorbție mult crescută a fondurilor europene.
